import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: 'center',
    },
    header: {
        fontWeight: 'bold',
        fontSize: 45,
        textAlign: 'center',
        color: '#e9c46a'
    },
    boxContainer: {
        borderRadius: 50,
        marginTop: 50,
        padding: 45,
        borderWidth: 2,
        borderColor: 'grey',
        backgroundColor: '#2a9d8f'
    },
    stickyContainer: {
        backgroundColor: '#f4a261',
        marginVertical: 20
    }
});

export default styles;
